/**
 * 绘制飞机(弃用)
 * @param {CanvasRenderingContext2D} ctx 画布对象
 * @param {any} x0
 * @param {any} y0
 * @param {any} w
 * @param {any} c
 */
myglobal.image.drawPlane1 = function (ctx,x0, y0, w, c) {
    ctx.beginPath();
    ctx.moveTo(x0 - 10, y0 - 100);
    ctx.arc(x0, y0 - 100, 10, Math.PI, 2 * Math.PI);
    ctx.lineTo(x0 + 10, y0 - 100);
    ctx.lineTo(x0 + 8, y0 - 10);
    ctx.lineTo(x0 + 100, y0);
    ctx.lineTo(x0 + 100, y0 + 10);
    ctx.lineTo(x0 + 7, y0 + 10);
    ctx.lineTo(x0 + 5, y0 + 80);
    ctx.lineTo(x0 + 20, y0 + 82);
    ctx.lineTo(x0 + 20, y0 + 92);
    ctx.lineTo(x0 - 20, y0 + 92);
    ctx.lineTo(x0 - 20, y0 + 82)
    ctx.lineTo(x0 - 5, y0 + 80);;
    ctx.lineTo(x0 - 7, y0 + 10);
    ctx.lineTo(x0 - 100, y0 + 10);
    ctx.lineTo(x0 - 100, y0);
    ctx.lineTo(x0 - 8, y0 - 10);
    ctx.lineTo(x0 - 10, y0 - 100);
    ctx.strokeStyle = c;
    ctx.lineCap = "point";
    ctx.lineWidth = w;
    ctx.closePath();
    ctx.stroke();
};

/**
 * 绘制飞机
 * @param {CanvasRenderingContext2D} ctx 画布对象
 * @param {HTMLImageElement} img 飞机图像
 */
myglobal.image.drawPlane2 = function (ctx, x0, y0, w, h, img) {
    if (document.getElementById("player") == null) {
        var image = new Image(w, h);
        image.src = img.src;
        image.style.display = "none";
        image.id = "player";
        lt_code.addChild(image, myglobal.image.displayBox);
    } else {
        var image = img;
    }
    var x = x0 - w / 2;
    var y = y0 - h / 2;
    ctx.drawImage(image, x, y, w, h);
};

/**
 * 绘制飞机
 * @param {CanvasRenderingContext2D} ctx
 * @param {any} x0
 * @param {any} y0
 * @param {any} w
 * @param {any} h
 * @param {string} img (base64编码的图片)
 */
myglobal.image.drawPlane3 = function (ctx, x0, y0, w, h, img) {
    var image = new Image(w, h);
    image.src = img;
    var x = x0 - w / 2;
    var y = y0 - h / 2;
    ctx.drawImage(image, x, y, w, h);
}